import { Morph } from "lively.morphic/morph.js";
import { Database } from "lively.storage/index.js";
import { truncate } from "lively.lang/string.js";
import { show, config, inspect } from "lively.morphic/index.js";
import { localInterface, serverInterfaceFor } from "lively-system-interface/index.js";
import { Color } from "lively.graphics/index.js";

export default class StorageDbInspector extends Morph {

  static get properties() {

    return {
      currentDBName: {},
      // location: {values: ["browser", "server"]}
    }
  }

  reset() {
    let settings = this.submorphs.map(ea => [ea.name, this.layout.settingsFor(ea)])

    settings

    this.openInWorld()

    this.layout.submorphSettings = [["input line", {
      x: "resize",
      y: "fixed"
    }], ["doc list", {
      x: "fixed",
      y: "resize"
    }], ["rev button", {
      x: "move",
      y: "move"
    }], ["save button", {
      x: "move",
      y: "move"
    }], ["doc content", {
      x: "resize",
      y: "resize"
    }], ["location chooser", {
      x: "move",
      y: "fixed"
    }]]

  }

  get systemInterface() {
    let location = this.get("location chooser").selection;
    return location === "server" ? serverInterfaceFor(config.remotes.server) : localInterface;
  }

  async run(source) {
    let result = await this.systemInterface.runEval(`
      import { Database } from "lively.storage";
      ${source}
    `, {targetModule: "lively://StorageDBInspector/eval"});
    if (result.isError) throw result.value
    return result.value;
  }

  async tryToLoadDB(dbName) {
    // dbName = this.get("input line").input;
    this.get("doc list").items = [];
    this.get("doc content").textString = "";
    let known = await this.run(`await Database.knowsDB("${dbName}");`)
    if (!known) return;
    this.get("input line").addInputToHistory(dbName)
    this.currentDBName = dbName;
    return this.updateDocList();
  }

  async updateDocList() {
    let docs = await this.run(`
      let db = await Database.ensureDB("${this.currentDBName}");
      await db.docList();`);
    let items = docs.map(ea => {
      let {id, rev} = ea;
      return {
        isListItem: true,
        string: `${truncate(id, 30)} - ${rev.split("-")[0]}`,
        value: ea
      };
    })

    // this.get("doc list").fontFamily = "monospace"
    this.get("doc list").items = items;
  }

  onDocumentSelected() {
    let sel = this.get("doc list").selection;
    if (!sel) {
      this.get("doc content").textString = "";
      return;
    }
    return this.selectDocWithId(sel.id);
  }

  selectedDoc() {
    let sel = this.get("doc list").selection;
    return sel ? this.run(`
      let db = await Database.ensureDB("${this.currentDBName}");
      await db.get("${sel.id}");`) : null;
  }

  async selectDocWithId(id) {
    // await this.selectDocWithId("1084c943ddca4410ddaf0927dc0294eecad82a20")
    if (this._docListUpdate) return;
    this._docListUpdate = true;
    try {
      let val = this.get("doc list").values.find(ea => ea.id === id);
      if (!val) {
        this.setStatusMessage(`document with id ${id} not found`);
        this.get("doc content").textString = "";
        this.get("doc list").selection = null;
        return;
      }
      this.get("doc list").selection = val;
      let doc = await this.selectedDoc();
      this.get("doc content").textString = JSON.stringify(doc, null, 2);
    } finally {
      this._docListUpdate = false;
    }
  }

  async saveDoc() {
    let sel = this.get("doc list").selection;
    if (!sel) return;

    let id = sel.id, doc, content = this.get("doc content").textString;
    try {
      doc = JSON.parse(content);
      delete doc._rev;
    } catch (err) { this.showError(err); return }

    if (doc._id !== id) {
      let cont = await $world.confirm(`Selected document id does not match id in JSON, continue saving as ${doc._id}?`, {requester: this});
      if (!cont) return;
    }

    await this.run(`
      let db = await Database.ensureDB("${this.currentDBName}");
      await db.set("${doc._id}", ${JSON.stringify(doc)});`);

    await this.updateDocList();
    await this.selectDocWithId(doc._id);

    this.setStatusMessage("saved", Color.green);
  }

  async chooseRevision() {
    let sel = this.get("doc list").selection;
    if (!sel) return;
    let text = this.get("doc content"),
        {_id: id} = await this.selectedDoc(),
        {currentDBName} = this,
        revList = await this.run(`
          let db = await Database.ensureDB("${currentDBName}");
          await db.revList("${id}")`),
        oldContent = text.textString;

    let {selected: [choice]} = await $world.filterableListPrompt(
          "choose revision", revList, {
            // requester: this,
            onSelection: async rev => {
              try {
                let [doc] = await this.run(`
                  let db = await Database.ensureDB("${currentDBName}");
                  await db.getDocuments([{id: "${id}", rev: "${rev}"}])`);
                text.textString = JSON.stringify(doc, null, 2);
              } catch (err) { this.showError(err); }
            }
          });

    if (!choice) text.textString = oldContent

  }
}
